import React from 'react';
import "./style/Wifi.css";
import {FormLabel} from '@material-ui/core';
import { Link } from 'react-router-dom';
import TextField from '@material-ui/core/TextField';
import {ReactComponent as Vec} from "./assets/vec.svg"


const Wifi = () => {

    const styleBot = {
        border: "solid white",
        paddingTop : "20px",
        paddingBottom : "20px",
        borderRadius: "30px",
        paddingRight:"10px",
        paddingLeft:"10px", 
        textAlign: "center" , 
        justifyContent: "center" ,
        alignItems: "center" , 
        width: "20%",
        marginLeft: "700px",
        marginRight:"720px",
        marginTop:"830px"
    }

    return(
        <>
        <h1 className="tit">CONNEXION WIFI</h1>
        <h1 className="par">Veuillez renseigner le nom de votre réseau WiFi ainsi que sa clé de sécurité </h1>
        <Vec className="rec1" />
        <TextField className="no" id="standard-basic" variant="standard" label="Nom" />
        <Vec className="rec2" />
        <Link to="Home" style={{ textDecoration: 'none' }}>
                <div style={styleBot}>
                <FormLabel style={{color : 'white' ,fontSize : 20 , marginBottom: 100 , marginTop: 100 , marginRight : 50 , marginLeft : 50 , justifyContent: "center" , textAlign: "center" }}>Confirmer</FormLabel>
                </div>
        </Link>
        </>
    );

};

export default Wifi;
